package mk.ukim.finki.moviewatchlist.config;


import lombok.Getter;
import lombok.RequiredArgsConstructor;
import mk.ukim.finki.moviewatchlist.model.Genre;
import mk.ukim.finki.moviewatchlist.model.Movie;
import mk.ukim.finki.moviewatchlist.service.MovieService;
import mk.ukim.finki.moviewatchlist.service.ReviewService;
import org.springframework.stereotype.Component;

import javax.annotation.PostConstruct;

@Component
@Getter
@RequiredArgsConstructor
public class DataHolder {
  private final MovieService movieService;
  private final ReviewService reviewService;

  @PostConstruct
  public void initData() {

    Movie movie1 = movieService.save("Pirates of the Caribbean", "Pirates of the Caribbean is a sweeping action-adventure story set in an era when villainous pirates scavenged the Caribbean seas", Genre.ACTION,
            "data:image/jpeg;base64,")
            .get();
    Movie movie2 = movieService.save("The Dark Knight", "Based on the DC Comics character Batman, the film is the second installment of Nolan's The Dark Knight Trilogy", Genre.ACTION,
            "data:image/jpeg;base64,")
            .get();
    movieService.save("Cars 3", "Cars 3 is a 2017 American computer-animated sports comedy-adventure film produced by Pixar Animation Studios and released by Walt Disney Pictures", Genre.COMEDY,
    "data:image/jpeg;base64,");
    movieService.save("Titanic", "Titanic, American romantic adventure film, released in 1997, that centres on the sinking of the RMS Titanic", Genre.ROMANCE,
            "data:image/jpeg;base64,");
    movieService.save("The Hangover", "The tale of how three friends tries to find the lost groom before his wedding after their crazy night in Las Vegas", Genre.COMEDY,
    "data:image/jpeg;base64,");

    reviewService.save(4, "would definitely recommend to watch", movie1);
    reviewService.save(5, "a must see", movie1);
    reviewService.save(1, "no plot twist", movie1);
    reviewService.save(3, "the cast is brilliant", movie1);
    reviewService.save(5, "love the actor", movie1);
    reviewService.save(4, "place holder 2", movie2);
  }
}
